import React from 'react'

const ProgressBar = (errorMessages) => {
    const headings = []
    // green - done; red - error ; grey - todo
    return (
        <div className='progress-bar'>
            <p className='progress-point'>About You</p>
            <p className='progress-point'>Your Interests</p>
            <p className='progress-point'>Your Skills</p>
            <p className='progress-point'>Your New Skills</p>
            <p className='progress-point'>Area of programming</p>
        </div>
    )
}

export default ProgressBar
